import React from "react";
import { Box } from "@mui/material";
import Button from "@mui/material/Button";
import { useNavigate } from "react-router-dom";

export default function ChatData({ chat }) {
  const navigate = useNavigate();

  // console.log("chat ", chat);
  return (
    <Box>
      {chat.map(
        (text) =>
          text.id != 0 && (
            <Box
              key={text.id}
              sx={{
                display: "flex",
                flexDirection: "column",
                margin: 2,
              }}
            >
              <p>{text.chat}</p>
              <p style={{ alignSelf: "flex-end" }}>{text.ai}</p>
              <Button onClick={() => navigate("/details")} variant="contained">
                Details
              </Button>
              <hr />
            </Box>
          )
      )}
    </Box>
  );
}
